import React, { Component, useState } from 'react';

function SignupComedian(){

    const [newComedian, setComedian] = useState({
        name: "",
        headshot_link: "",
        website: "",
        city: "",
        genre: ""
    })

    const changeHandler = (e) => {
        useState({ [e.target.name]: e.target.value })
    }

    return(
        <div className="signup">
            <h1>Comedian Signup</h1>
            <form>
                <input name="name" type="text" placeholder="enter name" value={newComedian["name"]} onChange={changeHandler} />
            </form>
        </div>

    )
}

export default SignupComedian
